<script id="shader-vs" type="x-shader/x-vertex">

  attribute vec3 aNorm;
  uniform mat4 mvMatrix;
  uniform mat4 prMatrix;
  varying vec3 col;
  const vec4 dirDif = vec4(0., 0., 1., 0.);
  const vec4 dirHalf = vec4(-.4034, .259, .8776, 0.);

//   col += vec3(1., 1., 1.) * pow( max( 0., dot(rotNorm, dirHalf) ), 40.);
}
</script>

}
</script>

function getShader ( gl, id ){
   var shaderScript = document.getElementById ( id );
   var str = "";
   var k = shaderScript.firstChild;
   while ( k ){
     if ( k.nodeType == 3 ) str += k.textContent;
     k = k.nextSibling;
   }
   var shader;
   if ( shaderScript.type == "x-shader/x-fragment" )
           shader = gl.createShader ( gl.FRAGMENT_SHADER );
   else if ( shaderScript.type == "x-shader/x-vertex" )
           shader = gl.createShader(gl.VERTEX_SHADER);
   else return null;
   gl.shaderSource(shader, str);
   gl.compileShader(shader);
   if (gl.getShaderParameter(shader, gl.COMPILE_STATUS) == 0)
      alert(gl.getShaderInfoLog(shader));
   return shader;
}

var canvas;
function webGLStart() {
   var gl,  size = Math.min(window.innerWidth, window.innerHeight) - 10;
   canvas = document.getElementById("canvas");
   var c_w = window.innerWidth - 50,  c_h = window.innerHeight - 10;
   canvas.width = c_w;   canvas.height = c_h;
   if (!window.WebGLRenderingContext){
     alert("Your browser does not support WebGL. See http://get.webgl.org");
     return;}
   try { gl = canvas.getContext("experimental-webgl");
   } catch(e) {}
   if ( !gl ) {alert("Can't get WebGL"); return;}
   gl.viewport(0, 0, c_w, c_h);

   var prog  = gl.createProgram();
   gl.attachShader(prog, getShader( gl, "shader-vs" ));
   gl.attachShader(prog, getShader( gl, "shader-fs" ));
   gl.linkProgram(prog);
   gl.useProgram(prog);

   var fl = f.length;

   var posLoc = gl.getAttribLocation(prog, "aPos");
   gl.enableVertexAttribArray( posLoc );
   var normLoc = gl.getAttribLocation(prog, "aNorm");
   gl.enableVertexAttribArray( normLoc );

   gl.bindBuffer(gl.ARRAY_BUFFER, gl.createBuffer());
   gl.bufferData(gl.ARRAY_BUFFER, v, gl.STATIC_DRAW);
   gl.vertexAttribPointer(posLoc,  3, gl.FLOAT, false, 24,  0);
   gl.vertexAttribPointer(normLoc, 3, gl.FLOAT, false, 24, 12);

   gl.bindBuffer(gl.ELEMENT_ARRAY_BUFFER, gl.createBuffer());
   gl.bufferData(gl.ELEMENT_ARRAY_BUFFER, f, gl.STATIC_DRAW);

   var prMatrix = new CanvasMatrix4();
   prMatrix.perspective(45, c_w/c_h, .1, 100);
   gl.uniformMatrix4fv( gl.getUniformLocation(prog,"prMatrix"),
      false, new Float32Array(prMatrix.getAsArray()) );
   var mvMatrix = new CanvasMatrix4();
   var rotMat = new CanvasMatrix4();
   rotMat.makeIdentity();
//   rotMat.rotate(90, 1,0,0);
   rotMat.rotate(150, 0,1,0);
   var mvMatLoc = gl.getUniformLocation(prog,"mvMatrix");

   gl.enable(gl.DEPTH_TEST);
   gl.depthFunc(gl.LEQUAL);
   gl.clearDepth(1.0);
   gl.clearColor(0, .5, 1, 1);
   var xOffs = yOffs = 0,  drag  = 0;
   var xRot = yRot = 0;
   var transl = -3;

   drawScene();

  function drawScene(){
    rotMat.rotate(xRot/5, 1,0,0);  rotMat.rotate(yRot/5, 0,1,0);
    yRot = 0;  xRot = 0;
    mvMatrix.makeIdentity();
    mvMatrix.translate(0, 0, 0);
    mvMatrix.multRight( rotMat );
    mvMatrix.translate(0, 0, transl);
    gl.clear(gl.COLOR_BUFFER_BIT | gl.DEPTH_BUFFER_BIT);
    gl.uniformMatrix4fv( mvMatLoc, false, new Float32Array(mvMatrix.getAsArray()) );
    gl.drawElements(gl.TRIANGLES, fl, gl.UNSIGNED_SHORT, 0);
    gl.flush ();
  }

  canvas.resize = function (){
    c_w = window.innerWidth - 50;  c_h = window.innerHeight - 10;
    canvas.width = c_w;   canvas.height = c_h;
    gl.viewport(0, 0, c_w, c_h);
    prMatrix.makeIdentity();
    prMatrix.perspective(45, c_w/c_h, .1, 100);
    gl.uniformMatrix4fv( gl.getUniformLocation(prog,"prMatrix"),
      false, new Float32Array(prMatrix.getAsArray()) );
    drawScene();
  }
  canvas.onmousedown = function ( ev ){
     drag  = 1;
     xOffs = ev.clientX;  yOffs = ev.clientY;
  }
  canvas.onmouseup = function ( ev ){
     drag  = 0;
     xOffs = ev.clientX;  yOffs = ev.clientY;
  }
  canvas.onmousemove = function ( ev ){
     if ( drag == 0 ) return;
     if ( ev.shiftKey ) {
        transl *= 1 + (ev.clientY - yOffs)/1000;
        yRot = - xOffs + ev.clientX; }
     else {
        yRot = - xOffs + ev.clientX;  xRot = - yOffs + ev.clientY; }
     xOffs = ev.clientX;  yOffs = ev.clientY;
     drawScene();
  }
  var wheelHandler = function(ev) {
    var del = 1.1;
    if (ev.shiftKey) del = 1.01;
    var ds = ((ev.detail || ev.wheelDelta) > 0) ? del : (1 / del);
    transl *= ds;
    drawScene();
    ev.preventDefault();
  };
  canvas.addEventListener('DOMMouseScroll', wheelHandler, false);
  canvas.addEventListener('mousewheel', wheelHandler, false);
}
</script>
